import React, { useState } from "react";
import Landing from "./Landing.js";
import Projects from "./Projects.js";
import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";

function Home() {
  const [btn1, setLanding] = useState("1");
  const [btn2, setProjects] = useState("2");
  const [btn3, setResume] = useState("3");

  const stageLanding = (label) => {
    setLanding(label);
  };
  const stageProjects = (label) => {
    setProjects(label);
  };
  const stageResume = (label) => {
    setResume(label);
  };

  return (
    <div>
      <div className="sticky">
        <Button className="my-1" onMouseEnter={() => stageLanding("Landing")}>
          {btn1}
        </Button>
        <Button className="my-1" onMouseEnter={() => stageProjects("Projects")}>
          {btn2}
        </Button>
        <Button className="my-1" onMouseEnter={() => stageResume("Resume")}>
          {btn3}
        </Button>
      </div>
      <Landing />
      <Projects />
    </div>
  );
}

export default Home;
